import React from "react";
import { Typography, styled, Box, Stack } from "@mui/material";

import hero from "../../assets/img/hero.svg";
import logo from "../../assets/img/logo.svg";
import { height } from "@mui/system";

// Styling component
const HeroImg = styled("div")({
  backgroundImage: `url(${hero})`,
  height: "100vh",
  backgroundRepeat: "no-repeat",
  backgroundSize: "cover",
  filter: " brightness(40%)",
});

const HomeTitle = styled("Typography")({
  color: "#FFFFFF",
  fontSize: "38px", // 32px
});

const Navbar = styled("div")({
  width: "100%",
  height: "100px",
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  backgroundColor: "rgba(217, 217, 217, 0.35)",
});

const CtaContainer = styled("div")({
  width: "100%",
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
});

const CtaText = styled("Typography")({
  fontFamily: "Send Flowers",
});
const Home = () => {
  const navbarItems = [
    "HOME",
    "WEDDING",
    "OUR STORY",
    "OUR GALLERY",
    "BLOG",
    "CONTACT US",
  ];
  return (
    <HeroImg>
      <Stack direction="row" align justifyContent="center" alignItems="center">
        <HomeTitle variant="home">EVENT</HomeTitle>
        <img src={logo} width="100px" alt="logo" />
        <HomeTitle variant="home">SOLUTION</HomeTitle>
      </Stack>
      <Navbar>
        <Stack direction={"row"} spacing={5}>
          {navbarItems.map((i) => (
            <Typography variant="navbar">{i}</Typography>
          ))}
        </Stack>
      </Navbar>

      <CtaContainer>
        <Typography>Weâ€™ll make your happy moment unforgettable</Typography>
      </CtaContainer>
    </HeroImg>
  );
};

export default Home;
